webpackJsonp([0xba989b6cca28],{520:function(n,s){n.exports={pathContext:{frontmatter:{path:"docs/align-content",title:"Align Content",hasPlayground:!0,initialPlayground:"",redirect:null},html:"<h2>Align Content</h2>\n<p>Align content defines the distribution of lines along the cross-axis. This only\nhas effect when items are wrapped to multiple lines using <a href=\"flex-wrap\"><code>flex wrap</code></a>.</p>\n<p><strong>FLEX START (DEFAULT)</strong> Align wrapped lines to the start of the container's cross axis.</p>\n<p><strong>FLEX END</strong> Align wrapped lines to the end of the container's cross axis.</p>\n<p><strong>STRETCH</strong> Stretch wrapped lines to match the <code>height</code> of the container's cross axis.</p>\n<p><strong>CENTER</strong> Align wrapped lines in the center of the container's cross axis.</p>\n<p><strong>SPACE BETWEEN</strong> Evenly space wrapped lines across the container's main axis, distributing\nremaining space between the lines.</p>\n<p><strong>SPACE AROUND</strong> Evenly space wrapped lines across the container's main axis, distributing\nremaining space around the lines. Compared to <code>space between</code> using\n<code>space around</code> will result in space being distributed to the begining of\nthe first lines and end of the last line.</p>\n<p><controls prop=\"alignContent\"></controls></p>"}}}});
